import { Link, useNavigate } from 'react-router-dom';
import React, { useContext } from 'react';
import { AuthContext } from '../context/AuthContext';

export default function Navbar({ isMobile, onToggleSidebar }) {
  const { authState, setAuthState } = useContext(AuthContext);
  const navigate = useNavigate();

  // 角色权限层级映射
  const roleHierarchy = { admin: 3, operator: 2, user: 1 };

  // 角色切换处理器 (带过渡动画)
  const handleRoleChange = (newRole) => {
    const currentLevel = roleHierarchy[authState.realRole];
    const newLevel = roleHierarchy[newRole];

    if (newLevel > currentLevel) {
      // 权限不足流程
      alert('权限不足，请使用对应权限账号登录！');
      setAuthState({
        isAuthenticated: false,
        realRole: 'user',
        currentRole: 'user'
      });
      navigate('/login', { state: { requireUpgrade: true } });
    } else {
      // 合法切换流程
      setAuthState(prev => ({
        ...prev,
        currentRole: newRole
      }));
      // 触发布局重排动画
      document.documentElement.style.setProperty('--sidebar-width', isMobile ? '0' : '240px');
    }
  };

  // 角色选项配置
  const roleOptions = [
    { value: 'user', label: '普通用户' },
    { value: 'operator', label: '操作员' },
    { value: 'admin', label: '管理员' }
  ];

  return (
    <nav style={{
      background: '#2c3e50',
      color: 'white',
      padding: '15px 20px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      position: 'sticky',
      top: 0,
      zIndex: 1000, // 降低层级避免覆盖侧边栏
      boxShadow: '0 2px 8px rgba(0,0,0,0.1)'
    }}>
      {/* 左侧导航区 */}
      <div style={{ 
        display: 'flex', 
        alignItems: 'center', 
        gap: '15px',
        flex: 1  // 新增弹性布局
      }}>
        {isMobile && (
          <button 
            onClick={onToggleSidebar}
            style={{
              background: 'rgba(255,255,255,0.1)',
              border: 'none',
              color: 'white',
              fontSize: '24px',
              cursor: 'pointer',
              padding: '4px 8px',
              borderRadius: '4px',
              transition: 'background 0.2s',
              ':hover': {
                background: 'rgba(255,255,255,0.2)'
              }
            }}
            aria-label="切换菜单"
          >
            ☰
          </button>
        )}
        <Link to="/" style={{ 
          textDecoration: 'none', 
          color: 'white',
          fontSize: 'clamp(1rem, 2vw, 1.25rem)',
          fontWeight: '600',
          whiteSpace: 'nowrap',
          marginLeft: isMobile ? '8px' : '0'  // 移动端微调
        }}>
          OCEAN SYSTEM
        </Link>
      </div>

      {/* 右侧用户区 */}
      <div style={{ 
        display: 'flex', 
        alignItems: 'center', 
        gap: '1rem',
        position: 'relative',
        flex: 0  // 禁止扩展
      }}>
        {/* 角色切换下拉框 */}
        <div style={{ position: 'relative' }}>
          <select
            value={authState.currentRole}
            onChange={(e) => handleRoleChange(e.target.value)}
            style={{
              appearance: 'none',
              background: '#34495e',
              color: 'white',
              border: 'none',
              borderRadius: '20px',
              padding: '8px 32px 8px 16px',
              fontSize: '0.875rem',
              cursor: 'pointer',
              transition: 'all 0.2s',
              ':hover': {
                background: '#3b5165'
              }
            }}
          >
            {roleOptions.map(option => (
              <option 
                key={option.value} 
                value={option.value}
                style={{ background: '#2c3e50' }}
              >
                {option.label}
              </option>
            ))}
          </select>
          {/* 自定义下拉箭头 */}
          <div style={{
            position: 'absolute',
            right: '12px',
            top: '50%',
            transform: 'translateY(-50%)',
            pointerEvents: 'none',
            color: '#7f8c8d'
          }}>
            ▼
          </div>
        </div>

        {/* 用户标识 */}
        <div style={{
          display: 'flex',
          alignItems: 'center',
          gap: '12px',
          background: 'rgba(255,255,255,0.1)',
          padding: '6px 12px 6px 6px',
          borderRadius: '24px',
          transition: 'all 0.2s',
          ':hover': {
            background: 'rgba(255,255,255,0.15)'
          }
        }}>
          <div style={{
            width: '36px',
            height: '36px',
            borderRadius: '50%',
            background: '#3498db',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            fontSize: '18px',
            fontWeight: '500'
          }}>
            {authState.currentRole[0].toUpperCase()}
          </div>
          <span style={{ 
            fontSize: '0.875rem',
            textTransform: 'uppercase',
            letterSpacing: '0.5px'
          }}>
            {authState.currentRole}
          </span>
        </div>
      </div>
    </nav>
  );
}
